import styled from 'styled-components'


export default styled.div`
grid-area: VD;
display: flex;
flex-direction: column;
align-items: center;
/* background-color:var(--quaternary); */
img{
  width:90%; 
  height:90%;
}
div{
display:flex;
flex-direction: row;
button{
height:30px;
background:#4444df;
padding:3px;
  /* align-self: flex-start */
}
}


`
